import {Link} from "react-router-dom"

function Homepage(){
    return(
        <div className='Homepage'>
        <Link to="/loginstudent">Login as student</Link>
        <button path='/loginprofessor'>Login as professor</button>
    </div>
    )
}

export default Homepage
